import React from 'react';

function ImagenCargada({ selectedImageInfo }) {
  return (
    <div className="imgcargada">
      Imagen Cargada
      <div className="muestraimagen">
        {/* Aquí puedes usar la información de selectedImageInfo para mostrar la imagen */}
        <img
          src={`data:image/png;base64,${selectedImageInfo}`}
          alt="Imagen cargada"
          style={{ width: '200px', height: '300px' }}
          className="img"
        />
      </div>
    </div>
  );
}

export default ImagenCargada;
